import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { StyledDiv, StyledWrapper, StyledHeader } from "./Style.jsx"

function ResponseDisplay() {

  const navigate = useNavigate()
  const [responses, setResponses] = useState([])
  const clear_url = "/questions/responses"

  async function handleEdit(index) {
    navigate(`/Edit/${index}`) // navigates to summary page 
  }

  async function handleClear(e) {
    const newResponse = {
      method: "PUT",
      mode: "cors",
    }
    const response = await fetch(clear_url, newResponse) // put request to server 
    const server_response = await response.json()
    console.log("server replied:", server_response)
    navigate(0)
    alert("Responses cleared")
  }

  // fetch data
  useEffect(() => {
    const fetchData = async () => {
      const _data = await fetch("http://localhost:3500/questions/responses")
      .then(res => res.json())
      .then(resJson => {setResponses(resJson)})
    }

    fetchData()
    .catch(console.error)
    sleep(1000)
    console.log(responses)
  } , [])

  const [data, setData] = useState({
    name: " ",
    colour: {
      Blue: false,
      Red: false,
      Green: false,
      Yellow: false,
      Purple: false,
      Pink: false
    },
    prog_lang: {
      Python: false,
      Java: false,
      Ruby: false,
      JavaScript: false,
      Golang: false
    },
    languages: {
      English: false,
      Chinese: false,
      Malay: false,
